(QLT.)</td><td>Non - Reactive</td><td><strong>Flucculation</strong></td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>▣</strong>Triple / Febrile&nbsp; Antigen :</td><td>&nbsp;</td><td><strong>Agglutination Ref. Titre</strong></td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td rowspan=\"4\"><strong>●Widal Test</strong></td><td>TO</td><td>1:</td><td>1:80</td></tr><tr><td>TH</td><td>1:</td><td>1:80</td></tr><tr><td>AH</td><td>1:</td><td>1:80</td></tr><tr><td>BH</td><td>1:</td><td>1:80</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td rowspan=\"3\"><p><strong>● Proteus group</strong></p><p><strong>&nbsp; &nbsp; (Rickettsial)</strong></p></td><td>OX-K</td><td>1:</td><td>1:80</td></tr><tr><td>OX-2</td><td>1:</td><td>1:80</td></tr><tr><td>OX-19</td><td>1:</td><td>1:80</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td rowspan=\"2\"><p><strong>● Anti-Brucella</strong></p><p><strong>&nbsp; &nbsp; &nbsp;( Ab.)</strong></p></td><td>B. Abortus</td><td>1:40</td><td>1:40</td></tr><tr><td>B. Melitensis</td><td>1:40</td><td>1:40</td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><strong>▣</strong>Anti-<strong>Filariasis</strong> (Ab)- IgG</td><td>Negative (-ve)</td><td>(ICT Device–MedNet GmbH&nbsp; Germany)</td></tr><tr><td><strong>▣</strong>Anti-<strong>Filariasis</strong> (Ab)-IgM</td><td>Negative (-ve)</td><td>(ICT Device–MedNet GmbH&nbsp; Germany)</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>▣ </strong>Anti <strong>HCV</strong> (Screening)</td><td>&nbsp;</td><td>&nbsp;(ICT Device - SD Bioline)</td></tr><tr><td><strong>▣ </strong>Anti <strong>HIV</strong> (Screening)</td><td>&nbsp;</td><td>(ICT Device)</td></tr><tr><td><strong>▣ </strong>HB<strong>e</strong>Ag</td><td>&nbsp;</td><td>(ICT Device)</td></tr><tr><td><strong>▣ </strong>HB<strong>e</strong>Ab</td><td>&nbsp;</td><td>&nbsp;</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>▣ Leishmania</strong> (Ab)- IgG</td><td>Negative (-ve)</td><td>(ICT Device–MedNet GmbH) Germany)</td></tr><tr><td><strong>▣ Leishmania</strong> (Ab)- IgM</td><td>Negative (-ve)</td><td>(ICT Device–MedNet GmbH) Germany)</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>▣ D</strong>engue <strong>NS1Ag</strong></td><td>Negative (-ve)</td><td>(ICT Device–MedNet GmbH) Germany</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>▣</strong>Anti-<strong>Dengue</strong> (Ab)- IgG</td><td>Negative (-ve)</td><td>(ICT Device–MedNet GmbH) Germany</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>▣ </strong>Anti-<strong>Dengue</strong> (Ab)-IgM</td><td>Negative (-ve)</td><td>(ICT Device–MedNet GmbH) Germany</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>▣Malaria Parasite (Ag)</strong></td><td>Negative (-ve)</td><td>(ICT Device–CTKUSA)</td></tr><tr><td><strong>▣Malaria Parasite (Ag)</strong></td><td>Negative (-ve)</td><td>(ICT Device–CTKUSA)</td></tr><tr><td><strong>▣Troponin I</strong></td><td>Negative (-ve)</td><td>(ICT Device-CTKUSA)</td></tr><tr><td><strong>▣Chikungunya</strong> (Ab)- IgG</td><td>Negative (-ve)</td><td>(ICT Device–SD Biosensor) Korea</td></tr><tr><td><strong>▣Chikungunya</strong> (Ab)- IgM</td><td>Negative (-ve)</td><td>(ICT Device–SD Biosensor) Korea</td></tr></tbody></table></figure><p>&nbsp;</p>', '2025-04-24 01:15:17', '2025-04-24 01:15:17'),
